import React from "react";
// import home from "../../images/profile.png";
// import education from "../../images/education.png";
// import certificate from "../../images/certifications.png";
// import project from "../../images/projects.png";
// import connect from "../../images/connect.png";
import "./Header.css";
import { NavLink } from "react-router-dom";

const Header = () => {
  return (
    <>
      <div className="navBar">
        <NavLink className="navImage" activeclass="active" onClick={()=>document.getElementById("profile").scrollIntoView()}>
          {/* <img src={home} alt="Home" /> */}
          <i class="fa-solid fa-house"></i>
          <p>Profile</p>
        </NavLink>
        <NavLink className="navImage" activeclass="active" onClick={()=>document.getElementById("edu").scrollIntoView()}>
          {/* <img src={education} alt="Education" /> */}
          <i class="fa-solid fa-graduation-cap"></i>
          <p>Education</p>
        </NavLink>
        <NavLink className="navImage" activeclass="active" onClick={()=>document.getElementById("certifications").scrollIntoView()}>
          {/* <img src={certificate} alt="Activities & Achievements" /> */}
          <i class="fa-solid fa-award"></i>
          <p>Activities & Achievements</p>
        </NavLink>
        <NavLink className="navImage" activeclass="active" onClick={()=>document.getElementById("projects").scrollIntoView()} >
          {/* <img src={project} alt="Projects" /> */}
          
          <p>Projects</p>
        </NavLink>
        <NavLink className="navImage" activeclass="active" onClick={()=>document.getElementById("connect").scrollIntoView()}>
          {/* <img src={connect} alt="Connect" /> */}
          <p>Connect</p>
        </NavLink>
      </div>
    </>
  );
};

export default Header;
